<webobject name="PageWrapper">
   <webobject name="ListNotEmpty">
      <center>
         <table width="100%" border="0">
            <tr>
               <td align="center" width="100%">
                  <webobject name="NavBar"></webobject></td>
            </tr>
            <tr>
               <td>&nbsp;</td>
            </tr>
         </table>
         <webobject name="ListTable">
            <tr>
               <th></th>
               <webobject name="ColumnLabelRepetition">
                  <th nowrap valign="bottom">
                     <webobject name="PropertyName"></webobject>
                     <webobject name="IsPropertySortable">
                        <webobject name="AttributeSorter"></webobject>
                     </webobject>
                  </th>
               </webobject>
            </tr>
            <webobject name="EntityRepetition">
               <webobject name="RowContainer">
                  <td valign="middle">
                     <webobject name="IsSelecting">
                        <webobject name="SelectEO"><WEBOBJECT NAME="SelectImage"></webobject></webobject>
                     </webobject>
                     <webobject name="IsListing">
                        <webobject name="IsEntityWritable">
                           <webobject name="EditEO"><webobject name="EditImage"></webobject></webobject>
                        </webobject>
                        <webobject name="IsEntityNotWritable">
                           <webobject name="InspectEO"><webobject name="InspectImage"></webobject></webobject>
                        </webobject>
                     </webobject>
                  </td>
                  <webobject name="AttributeRepetition"><webobject name="AttributeCell"><webobject name="AttributeDisplay"></webobject></webobject></webobject>
                  <webobject name="IsListing2">
                     <webobject name="IsEntityWritable2">
                        <td valign="middle"><webobject name="DeleteEO"><webobject name="DeleteImage"></webobject></webobject></td>
                     </webobject>
                  </webobject>
               </webobject>
            </webobject>
         </webobject>
         <br>
         <webobject name="HideReturnOnSelect1"><webobject name="ShowCancel"><webobject name="BackLink"><webobject name="ReturnButton"></webobject></webobject></webobject></webobject>
      </center>
   </webobject>
   <webobject name="ListEmpty">
      <br>
      <table>
         <tr>
            <td>&nbsp;</td>
         </tr>
         <tr>
            <td><webobject name="ExclamationImage"></webobject></td>
            <td>
               <center>
                  <font color="#ff0000"><b>No matching
                  <webobject name="EntityName"></webobject>
                  records found.</b></font>
               </center>
            </td>
         </tr>
      </table>
      <br>
      <br>
      <webobject name="HideReturnOnSelect2"><webobject name="ShowCancel2"><webobject name="BackLink2"><webobject name="ReturnButton2"></webobject></webobject></webobject></webobject>
   </webobject>
</webobject>
